import style from "./Card.module.css"

 // llega objeto, puedo hacer destructuring! {}

 export default function Card({id, name, status, species, gender, origin, image, onClose}) {
   return (
      <div className={style.container}>
         <button onClick={onClose} className={style.closeButton}>X</button>
         <h3 className={style.texts}>{name} </h3>
         <img src={image} alt='' />
         <h3 className={style.texts}>{species}</h3>
         <h3 className={style.texts}>{gender}</h3>
         <h3 className={style.texts}>{status}</h3>
         <h3 className={style.texts}>{origin}</h3>
      </div>
   );
}

